import React, { useContext, useEffect, useState } from "react";
import { UserContext } from "../context/UserProvider";
import {
  gastosPosicion7,
  gastosPosicion8,
  gastosPosicion9,
  gastosPosicion10,
} from "../utils/constants";

const JornadasClasification = () => {
  const { getTeam, getWeeklyClasification } = useContext(UserContext);
  const [weeklyClasification, setWeeklyClasification] = useState([]);
  const [weekSelected, setWeekSelected] = useState(1);
  const [position7, setPosition7] = useState([]);
  const [position8, setPosition8] = useState([]);
  const [position9, setPosition9] = useState([]);
  const [position10, setPosition10] = useState([]);

  useEffect(() => {
    // WEEKLY
    fetchWeeks();
  }, []);

  const teams = async (week, weekNumber) => {
    let team7 = await getTeam(week[weekNumber.length - 1]?.position7);
    let team8 = await getTeam(week[weekNumber.length - 1]?.position8);
    let team9 = await getTeam(week[weekNumber.length - 1]?.position9);
    let team10 = await getTeam(week[weekNumber.length - 1]?.position10);

    setPosition7(team7);
    setPosition8(team8);
    setPosition9(team9);
    setPosition10(team10);
  };

  const fetchWeeks = async () => {
    let teamsWeekly = await getWeeklyClasification();
    setWeeklyClasification(teamsWeekly);

    teams(teamsWeekly, teamsWeekly);
  };

  const handleWeek = async (week) => {
    console.log(week);
    teams(weeklyClasification, week);
  };

  return (
    <div className="informationTable">
      <h2>CLASIFICACIÓN GASTOS POR JORNADAS</h2>
      <div className="weeklySelector">
        <select onChange={(selection) => handleWeek(selection.target.value)}>
          {weeklyClasification.map((week) => {
            return (
              <option
                selected={week.id === weeklyClasification?.length}
                value={week.id}
              >
                Jornada {week.id}
              </option>
            );
          })}
        </select>
      </div>
      <div>
        <div className="tableHeader">
          <div className="teamColumn">Puesto</div>
          <div className="moneyColumn">Equipo</div>
        </div>
        <div>
          {/* POSITION 7 */}
          <div key={7}>
            <div className="tableBody">
              <div className="teamColumn">{position7[0]?.name}</div>
              <div className="moneyColumn">{gastosPosicion7}€</div>
            </div>
          </div>
          {/* POSITION 8 */}
          <div key={8}>
            <div className="tableBody">
              <div className="teamColumn">{position8[0]?.name}</div>
              <div className="moneyColumn">{gastosPosicion8}€</div>
            </div>
          </div>
          {/* POSITION 9 */}
          <div key={9}>
            <div className="tableBody">
              <div className="teamColumn">{position9[0]?.name}</div>
              <div className="moneyColumn">{gastosPosicion9}€</div>
            </div>
          </div>
          {/* POSITION 10 */}
          <div key={10}>
            <div className="tableBody">
              <div className="teamColumn">{position10[0]?.name}</div>
              <div className="moneyColumn">{gastosPosicion10}€</div>
            </div>
          </div>
        </div>
      </div>
    </div>
  );
};

export default JornadasClasification;
